public void startElement(String namespace,
                         String simple,
                         String qualified,
                         Attributes attributes) {
  int elemType = getElementType(qualified);
  switch (elemType) {
    case PAGE:
      title = null;
      body = null;
      time = null;
      id = null;
      break;
    // intentional fall-through.
    case BODY:
    case DATE:
    case TITLE:
    case ID:
      contents.setLength(0);
      break;
    default:
      // this element should be discarded.
  }
}

